pragma solidity ^0.8.0;

contract Member {

    mapping(string => address) public nameToAddress;
    mapping(address => string) public addressToName;
    address owner;
    address payable cfont;
    uint256 public fee = 0.05 ether;

    event nameAction(string, address, string);

    constructor(address payable _cfont){
        owner = msg.sender;
        cfont = _cfont;
    }

    function setFee(uint256 _fee) public{
        require(msg.sender == owner);
        fee = _fee;
    }

    function getName(address _address) public view returns(string memory){
        return addressToName[_address];
    }

    function getOwner(string memory _name) public view returns(address){
        return nameToAddress[_name];
    }

    function setName(string memory _name)payable public{
        require(bytes(_name).length <= 12);
        require(nameToAddress[_name] == address(0));
        require(msg.value >= fee);

        //remove old name
        nameToAddress[addressToName[msg.sender]] = address(0);
        //allocate new name
        nameToAddress[_name] = msg.sender;
        addressToName[msg.sender] = _name;

        cfont.transfer(fee);
        emit nameAction("setName", msg.sender, _name);
    }

    function removeName() public{
        nameToAddress[addressToName[msg.sender]] = address(0);
        addressToName[msg.sender] = "";
    }
}
